import React from 'react';
import Navbar from './Navbar';

const Home = () => {
  return (
    <div>
      <header className="bg-blue-900 text-white py-4">
        <h1 className="text-4xl font-bold ml-8">Flex</h1>
      </header>
      <Navbar />
      <div className="container mx-auto mt-8 px-4">
        <h1 className="text-3xl font-bold mb-4">Welcome to Flex Fitness</h1>
        <p className="text-xl">Get fit and stay healthy with our workout and exercise tracking app.</p>
      </div>
    </div>
  );
};

export default Home;
